window.bookSummaryJSON = "<p>The monsters almost made me love them.</p> <p>And now I’m paying the price.</p> <p>But so are they.</p> <p>Stellan, Cain, Remington, Paxton, and I are locked together in a war that I refuse to lose.</p> <p>They’ve taken my freedom, my money, my reputation…but they can’t take my soul.</p> <p>They keep forgetting I was forged in fire by a demon. Monsters don’t scare me.</p> <p>They think I’m trapped in their mansion with them. They think every time I seek their mouths, their hands, it means something.</p> <p>They think they can break me with their punishments…and their pleasures.</p> <p>But I’m only playing their game to win our war.</p> <p>One by one, I’ll find their secrets, however bloody they are, and make them think I’m saving them…only to use those dark secrets against them.</p> <p>Death. Bloodshed. Betrayal. And now sex. That’s all my life will ever be. Now it’s time to welcome these men into my nightmares.</p> <p>These monsters think they’re the kings of the world.</p> <p>But the king always falls without the queen.</p> <p>And the kings in this game...are going to burn.</p> <p>Book 2 of the Rich Demons of Darkwood series.</p> <p><b>*Recommended 18+ due to mature language, adult situations, triggers, and sensitive content.</b></p>"; 
